INSERT INTO PLACES (NAME, DESCRIPTION, ID_PLACE, ID, ID_LOCATION) VALUES ('Страна Греция', 'Этот город завлекает не только красотами и пейзажами, но и чудесной кухней. Ежегодно здесь бывают очень много туристов. Каждый посетитель отмечает, что отдых просто не збываем!', null, 'null', '1', '103');
INSERT INTO PLACES (NAME, DESCRIPTION, ID_PLACE, ID, ID_LOCATION) VALUES ('Страна Италия', 'Это один из самых популярных курортов нашего турагенства. Отдыхающим нравится местный климат, пейзажи и культура и многое другое.', null, 'null', '2', '104');
INSERT INTO PLACES (NAME, DESCRIPTION, ID_PLACE, ID, ID_LOCATION) VALUES ('Страна Греция', 'Это место, созданное природой и людьми, для прекрасного отдыха в живописном уголке Мира! Удобное расположение заметно выделяет его из числа других мест.', null, 'null', '3', '105');
INSERT INTO PLACES (NAME, DESCRIPTION, ID_PLACE, ID, ID_LOCATION) VALUES ('Страна Соединенное Королевство', 'Это один из самых популярных курортов нашего турагенства. Отдыхающим нравится местный климат, пейзажи и культура и многое другое.', null, 'null', '4', '106');
