INSERT INTO PLACES (NAME, DESCRIPTION, ID_PLACE, ID, ID_LOCATION) VALUES ('Страна Соединенное Королевство', 'Сюда приезжают отдыхать и взрослые и дети. Это место притягивает все больше и больше туристов. Культура, история, картины, которые сотворила природа и люди не оставят никого равнодушным.', null, 'null', '7', '109');
INSERT INTO PLACES (NAME, DESCRIPTION, ID_PLACE, ID, ID_LOCATION) VALUES ('Где: Россия. Название: Анапа', 'Этот город завлекает не только красотами и пейзажами, но и чудесной кухней. Ежегодно здесь бывают очень много туристов. Каждый посетитель отмечает, что отдых просто не збываем!', null, 'null', '8', '110');
INSERT INTO PLACES (NAME, DESCRIPTION, ID_PLACE, ID, ID_LOCATION) VALUES ('Где: Австралия. Название: Перт', 'Этот город завлекает не только красотами и пейзажами, но и чудесной кухней. Ежегодно здесь бывают очень много туристов. Каждый посетитель отмечает, что отдых просто не збываем!', null, 'null', '9', '111');
INSERT INTO PLACES (NAME, DESCRIPTION, ID_PLACE, ID, ID_LOCATION) VALUES ('Где: Австралия. Название: Ориндж', 'Это один из самых популярных курортов нашего турагенства. Отдыхающим нравится местный климат, пейзажи и культура и многое другое.', null, 'null', '10', '112');
